import React, { Fragment } from 'react';
const Productos = () => {
	return (
		<Fragment>
			<h2 className="text-center my-5">Listado de Productos</h2>
            <table className='table tbale-striped'>


                <thead className='bg-primary table-dark'></thead>
            </table>
		</Fragment>
	);
};

export default Productos;
